      await fetch("/restaurants.json")
        .then((res) => res.json())
        .then((data) => sethotels(data.restaurants));
    };
    fetchdata();
  }, []);

  console.log("our data", hotels);

  return (
    <>
      <Row>
        {hotels
          ? hotels.map((item) => (
              <Col sm={12} md={8} lg={6} xl={3}>

              </Col>
            ))
          : "error"}
      </Row>
    </>
  );
}

